import React from 'react'

const CommentList = ({comments}) => {
    return (
        comments?
        <div class="card card-outline-secondary my-4">
          <div class="card-header">
            Comments
          </div>
          <div class="card-body">
              {
                  comments.map(comment=>{
                      <Comment comment={comment} />
                  })
              }
          </div>
        </div>
        :
        null
    )
}
export default CommentList;
